package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import com.fasterxml.jackson.databind.annotation.JsonDeserialize;import com.fasterxml.jackson.databind.annotation.JsonSerialize;import com.rongke.utils.DateJsonDeserializer;import com.rongke.utils.DateJsonSerializer;import org.springframework.format.annotation.DateTimeFormat;import java.io.Serializable;/** * @WithdrawChannel * @渠道商提现记录(withdraw_channel) * @version : Ver 1.0 */@TableName("withdraw_channel")public class WithdrawChannel implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:主键id	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 * @备注:渠道商id	 * @字段:channel_id BIGINT(19)	 */	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long channelId;	/**	 * @备注:提现金额	 * @字段:money DECIMAL(10)	 */	private java.math.BigDecimal money;	/**	 * @备注:审核失败原因	 * @字段:reason VARCHAR(255)	 */	private String reason;	/**	 * @备注:到账银行卡	 * @字段:reason VARCHAR(255)	 */	private String bankNumber;	/**	 * @备注:银行卡用户姓名	 * @字段:reason VARCHAR(255)	 */	private String userName;	/**	 * @备注:	 * @字段:gmt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date gmtDatetime = new java.util.Date();	/**	 * @备注:	 * @字段:upt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date uptDatetime = new java.util.Date();	/**	 * @备注:1,审核中 2,审核失败 3,已打款	 * @字段:status INT(10)	 */	private Integer status;	public WithdrawChannel(){	}	public WithdrawChannel(		Long id	){		this.id = id;	}	public void setId(Long id) {		this.id = id;	}	public Long getId() {		return this.id;	}	public void setChannelId(Long channelId) {		this.channelId = channelId;	}	public Long getChannelId() {		return this.channelId;	}	public void setMoney(java.math.BigDecimal money) {		this.money = money;	}	public java.math.BigDecimal getMoney() {		return this.money;	}	public void setReason(String reason) {		this.reason = reason;	}	public String getReason() {		return this.reason;	}	public void setGmtDatetime(java.util.Date gmtDatetime) {		this.gmtDatetime = gmtDatetime;	}	public java.util.Date getGmtDatetime() {		return this.gmtDatetime;	}	public void setUptDatetime(java.util.Date uptDatetime) {		this.uptDatetime = uptDatetime;	}	public java.util.Date getUptDatetime() {		return this.uptDatetime;	}	public void setStatus(Integer status) {		this.status = status;	}	public Integer getStatus() {		return this.status;	}	public String getBankNumber() {		return bankNumber;	}	public void setBankNumber(String bankNumber) {		this.bankNumber = bankNumber;	}	public String getUserName() {		return userName;	}	public void setUserName(String userName) {		this.userName = userName;	}}